```jsx
import React, { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);

const Tooltip = ({ id, children, content }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useTooltip();

  const handleMouseEnter = () => {
    if (activeTooltip !== id) {
      openTooltip(id);
    }
  };

  const handleMouseLeave = () => {
    if (activeTooltip === id) {
      closeTooltip();
    }
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
      className={`relative ${activeTooltip === id ? 'z-10' : '-z-10'}`}
    >
      {children}
      {activeTooltip === id && (
        <div className="absolute top-full left-1/2 transform -translate-x-1/2 bg-white border border-gray-300 py-1 px-2 rounded shadow-lg">
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

