void *my_malloc(size_t size)
{
    Block *current, *prev, *new_block;

    if (size == 0)
        return 0;

    // Traverse the free list to find a block that fits our needs
    for (current = free_list; current != 0; current = current->next) {
        if (current->size == size) {
            current->free = 0;
            return (void *)(current + 1);
        }

        if (current->size > size && current->free) {
            // We found a block that is big enough, split it
            new_block = (void *)current + size;
            new_block->size = current->size - size;
            new_block->free = 1;
            new_block->next = current->next;
            current->size = size;
            current->free = 0;
            return (void *)(current + 1);
        }

        prev = current;
    }

    // No suitable block was found, add a new one at the end
    size = (size + sizeof(Block) + 7) & ~7;
    if (HEAP_SIZE - sizeof(Block) < size)
        return 0;

    new_block = (void *)heap + HEAP_SIZE - size;
    new_block->size = size;
    new_block->free = 0;
    new_block->next = 0;

    if (free_list == 0)
