Yes, you can write a Dynamics 365 plugin that sets a field to true if the user has a certain security role. Here's an example of how you could do this:

1. First, you'll need to retrieve the user's security roles. You can do this by querying the `systemuserroles` table and filtering on the `systemuserid` field.
2. Next, you'll need to check if the user has the specific security role you're interested in. You can do this by checking the `roleid` field in the `systemuserroles` table.
3. If the user has the security role, you can then set the field to true. You can do this by updating the entity that the field belongs to.

Here's some sample code that demonstrates how you could implement this in a plugin:
```
// Retrieve the user's security roles
var systemuserrolesQuery = new QueryExpression("systemuserroles");
systemuserrolesQuery.ColumnSet = new ColumnSet("roleid");
systemuserrolesQuery.Criteria.AddCondition("systemuserid", ConditionOperator.Equal, context.InitiatingUserId);

// Retrieve the user's roles
var systemuserroles = service.RetrieveMultiple(systemuserrolesQuery);

// Check if the user has the specific security role
bool hasRole = false;
foreach (var systemuserrole in systemuserroles.Entities)
{
    if (systemuserrole.GetAttributeValue<Guid>("roleid") == new Guid("your-role-guid-here"))
    {
        hasRole = true;
        break;
    }
}

// If the user has the role, set the field to true
if (hasRole)
{
    // Retrieve the entity that the field belongs to
    var entity = service.Retrieve(context.PrimaryEntityName, context.PrimaryEntityId, new ColumnSet("your-field-name-here"));

    // Set the field to true
    entity["your-field-name-here"] = true;

    // Update the entity
    service.Update(entity);
}
